class CreateNewP extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="container">
                <h3>Create a New Advertisement</h3>
            <form>
                <label for="name">Name</label>
                <input type="text" name="name" id="name"></input>
            </form>
                
                
                </div>
         );
    }
}
export default CreateNewP;
